const [theme, setTheme] = useState("Dark");

function Theme() {
    return <div>
        <select name="theme" id="cars" onChange={setTheme(value)}>
            <option value="Dark">Dark</option>
            <option value="Light">Light</option>
        </select>
    </div>
}

export { Theme, theme, setTheme }
